import "../App.css";
import React from "react";
import { useSelector } from "react-redux";

function Elektromos(){
    const auto = useSelector((state) => state.auto.autok);
  
    return (
      <div>
        <div className="container">
          {auto.map((el) => {
            const kep = `kepek/${el.kep}`;
            return (
              el.elektromos === "elektromos" && (
                <div key={el.kep}>
                  <p>{el.marka}</p>
                  <p>{el.ar}</p>
                  <img src={kep} alt="" />
                  <button>
                  </button>
                </div>
              )
            );
          })}
        </div>
      </div>
    );
}
export default Elektromos
